import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
export default function AdminRegistration(){
    const navigate = useNavigate();
    const [email, setEmail] = useState('');
    const [name, setName] = useState('');
    const [age, setAge] = useState('');
    const [address, setAddress] = useState('');
    const [contact, setContact] = useState('');
    const [position, setPosition] = useState('');
    const [error, setError] = useState('');
    const [password, setPassword] = useState('');

    const handleAdminLogin = () => {
        navigate('/adminlogin')
    }

    const handleVolLogin = () => {
        navigate('/')
    }

    const handleVolRegister = () => {
        navigate('/volregister')
    }
    const handleSubmit = (event) => {
        event.preventDefault();
        if (email === ''){
            setError('Invalid Email')
        }
        else if(password === ''){
            setError('Invalid Password')
        }
        else if (name === ''){
            setError('Invalid Name')
        }
        else if (age === ''){
            setError('Invalid Age')
        }
        else if (address === ''){
            setError('Invalid Address')
        }
        else if (contact === ''){
            setError('Invalid Contact Details')
        }
        else if (position === ''){
            setError('Invalid Position')
        }
        else{
            navigate('/adminlogin')
        }
    }

    return(
        <div  style={{textAlign: 'center', display: 'flex', justifyContent: 'center', backgroundColor: '#CCCCFF', height: '100vh'}}>
            <div style={{ border: '1px solid black', padding: '20px', marginTop: '8%', height: '67%', width: '40%', backgroundColor: 'white', color: 'black'}}>
                <h1>Administrator Registration</h1>
                <hr />
            <form onSubmit={handleSubmit}>
                <label>
                <p>Email <input type="text" onChange={e => setEmail(e.target.value)} /></p>
                </label>
                <label>
                <p>Password <input type="text" onChange={e => setPassword(e.target.value)} /></p>
                </label>
                <label>
                <p>Name <input type="text" onChange={e => setName(e.target.value)} /></p>
                </label>
                <label>
                <p>Age <input type="number" onChange={e => setAge(e.target.value)} /></p>
                </label>
                <label>
                <p>Position <input type="text" onChange={e => setPosition(e.target.value)} /></p>
                </label>
                <label>
                <p>Address <input type="text" onChange={e => setAddress(e.target.value)} /></p>
                </label>
                <label>
                <p>Contact <input type="number" onChange={e => setContact(e.target.value)} /></p>
                </label>
                <div>
                <button style ={{backgroundColor: '#CCCCFF', boxShadow: '0px 2px 2px lightgray', border: '1px solid black'}} type="submit">Submit</button>
                </div>
                {error && <div>{error}</div>}
                <br />
                <div>
                    <button style ={{backgroundColor: '#CCCCFF', display:'inline-block', boxShadow: '0px 2px 2px lightgray', border: '1px solid black'}} onClick={handleVolLogin}>Volunteer Login</button>  
                    <button style ={{backgroundColor: '#CCCCFF', display:'inline-block', boxShadow: '0px 2px 2px lightgray', border: '1px solid black', marginLeft: '2%'}} onClick={handleVolRegister}>Volunteer Registration</button>
                    <button style ={{backgroundColor: '#CCCCFF', display:'inline-block', boxShadow: '0px 2px 2px lightgray', border: '1px solid black', marginLeft: '2%'}} onClick={handleAdminLogin}>Admin Login</button>
                </div>
            </form>

            </div>

            <br />
            {/* <div>
                <button onClick={handleVolRegister}>Volunteer Registration</button>
                <button onClick={handleVolLogin}>Volunteer Login</button>
                <button onClick={handleAdminRegister}>Admin Registration</button>
            </div> */}
        </div>
    );
}
